ExceptionHeatMap_1.query:
q = load "ApexUnexpectedException";
q = filter q by 'EXCEPTION_MESSAGE' matches  "{{coalesce( cell(lens_6.selection, 0,"Exception Message Detail"),"exception").asString()}}";
q = foreach q generate 'EXCEPTION_TYPE' as 'EXCEPTION_TYPE', case when 'EXCEPTION_MESSAGE' matches "UNABLE_TO_LOCK" then "UNABLE_TO_LOCK" when 'EXCEPTION_MESSAGE' matches "CANNOT_INSERT_UPDATE_ACTIVATE_ENTITY" then "Field Access Rights" when 'EXCEPTION_MESSAGE' matches " FIELD_CUSTOM_VALIDATION" then "Custom Validation Rule" when 'EXCEPTION_MESSAGE' matches " FIELD_CUSTOM_VALIDATION_EXCEPTIO" then "Custom Validation Rule" when 'EXCEPTION_MESSAGE' matches "Attempt to de-reference" then "Attempt to de-reference a null object" when 'EXCEPTION_MESSAGE' matches "Too many query rows" then "Too many query rows" when 'EXCEPTION_MESSAGE' matches "CPU Time" then "Apex CPU Time Limit" when 'EXCEPTION_MESSAGE' matches "Too many queueable" then "Too many queueable jobs in queue" when 'EXCEPTION_MESSAGE' matches "List has no rows" then "List has no rows for assignment to SObject" when 'EXCEPTION_MESSAGE' matches "Too Many SOQL Queries" then "Too Many SOQL Queries" when 'EXCEPTION_MESSAGE' matches "Read timed out" then "Read timed out" when 'EXCEPTION_MESSAGE' matches "connection was cancelled" then "Connection Cancelled" when 'EXCEPTION_MESSAGE' matches "Too many DML rows" then "Too many DML rows" when 'EXCEPTION_MESSAGE' matches  "batchSize must not be null" then "Null Batch Size" when 'EXCEPTION_MESSAGE' matches "beforeUpdate" then "BeforeUpdate Trigger" when 'EXCEPTION_MESSAGE' matches "duplicate" then "Duplicate Row" when 'EXCEPTION_MESSAGE' matches "Record Currently Unavailable" then "Record Currently Unavailable" when 'EXCEPTION_MESSAGE' matches "TEMPLATE_NOT_ACTIVE" then "TEMPLATE_NOT_ACTIVE" when 'EXCEPTION_MESSAGE' matches "AfterUpdate" then "AfterUpdate Trigger" when 'EXCEPTION_MESSAGE' matches "BeforeInsert" then "BeforeInsert Trigger" when 'EXCEPTION_MESSAGE' matches "AfterInsert" then "AfterInsert Trigger" when 'EXCEPTION_MESSAGE' matches "ENTITY_IS_DELETED" then "ENTITY_IS_DELETED" when 'EXCEPTION_MESSAGE' matches "Apex heap size too large" then "Apex Heap (Memory)" when 'EXCEPTION_MESSAGE' matches "BeforeDelete" then "BeforeDelete" when 'EXCEPTION_MESSAGE' matches "INSUFFICIENT_ACCESS_ON_CROSS_REFERENCE_ENTITY" then "Access Rights" when 'EXCEPTION_MESSAGE' matches "failed to get force.com org details" then "Authentication Error" when 'EXCEPTION_MESSAGE' matches "No contact roles found for contract" then "Missing contact roles" when 'EXCEPTION_MESSAGE' matches "index out of bounds" then "index out of bounds" when 'EXCEPTION_MESSAGE' matches "Dependent class is invalid" then "Invalid Class" when 'EXCEPTION_MESSAGE' matches "Permission to access" then "Permission Denied" when 'EXCEPTION_MESSAGE' matches "group membership operation already in progress" then "Group Lock" when 'EXCEPTION_MESSAGE' matches "INVALID_CROSS_REFERENCE" then "Wrong ID"  when 'EXCEPTION_MESSAGE' matches "SObject row was retrieved" then "SOQL Field Error" when 'EXCEPTION_MESSAGE' matches "Invalid field" then "Invalid field" when 'EXCEPTION_MESSAGE' matches "Can only throw this exception" then "Exception Error" when 'EXCEPTION_MESSAGE' matches "Invalid Visualforce page parameter" then "Invalid Parameter" when 'EXCEPTION_MESSAGE' matches "Quote to oppty sync failed" then "Quote-Opp Sync Fail" when 'EXCEPTION_MESSAGE' matches "unexpected token" then "unexpected token" when 'EXCEPTION_MESSAGE' matches "SendEmail failed" then "SendEmail failed"  when 'EXCEPTION_MESSAGE' matches "Batchable instance is too big" then "Batch Size Error"  else "Unknown" end as 'Exception Message Detail', coalesce(substr('EXCEPTION_MESSAGE',index_of('EXCEPTION_MESSAGE',":",1)+1,index_of('EXCEPTION_MESSAGE',":",1,2)-index_of('EXCEPTION_MESSAGE',":",1)-1),"Unknown") as 'Class Name';
q = group q by ('Exception Message Detail', 'Class Name');
q = foreach q generate  'Class Name' as 'Class Name','Exception Message Detail' as 'Exception Message Detail', count() as 'count';
q = order q by ('count' desc,'Class Name' asc);
q = limit q 10000;

